<?php

$SoAfterAStruggleThisWasTheResult = "";

$counter = 0;
$TillTheEnd = 0;
$SequenceOfNumbers = array();
 
while ($TillTheEnd <= strlen($SoAfterAStruggleThisWasTheResult)){

  $current = substr($SoAfterAStruggleThisWasTheResult, $TillTheEnd, 1);
  $previous = substr($SoAfterAStruggleThisWasTheResult, ($TillTheEnd-1), 1);

  if($current == $previous){
    $counter++;
  } else {
    $SequenceOfNumbers[] =  $counter;
    $counter = 1;
  }

  $TillTheEnd++;

}

file_put_contents('GeneratedInputForStep5.txt', implode("  ", $SequenceOfNumbers));

?>